import { Component, OnInit } from '@angular/core';
import { DomSanitizer } from '@angular/platform-browser';
import { FormControl, FormGroup, Validators } from '@angular/forms';
import { faPaperPlane } from '@fortawesome/free-solid-svg-icons';
import { GuessTheImageService } from '../guess-the-image.service';

@Component({
  selector: 'app-blurreder-image',
  templateUrl: './blurred-image.component.html',
  styleUrls: ['./blurred-image.component.scss'],
})
export class BlurredImageComponent implements OnInit {
  private images!: string[];

  object!: string;
  showCounter: boolean = true;
  hasGuessed: boolean = false;
  countdown: number = 5;
  imageSource: any;
  paperPlane = faPaperPlane;

  formGroup: FormGroup = new FormGroup({
    guess: new FormControl(
      {
        value: null,
        disabled: false,
      },
      [Validators.required]
    ),
  });

  // image =
  //   '';

  constructor(
    private sanitizer: DomSanitizer,
    private guessTheImageService: GuessTheImageService
  ) {}

  private nextImageIndex = 0;
  private clearImage = '';
  ngOnInit(): void {
    this.guessTheImageService.getEvent().subscribe((res) => {
      this.images = res.baseImage.blurredImages.map(
        (blurredImage: any) => blurredImage.base64Image
      );
      this.clearImage = res.baseImage.base64Image;
      this.object = res.baseImage.object;
      this.imageSource = this.sanitizer.bypassSecurityTrustResourceUrl(
        `data:image/png;base64, ${this.images[this.nextImageIndex]}`
      );
      console.log(this.images[this.nextImageIndex]);
      console.log('------------------');
      console.log(this.imageSource);
    });

    const intervalId = setInterval(() => {
      this.countdown--;
      if (this.countdown < 0) {
        this.countdown = 2;
        ++this.nextImageIndex;
        if (this.nextImageIndex == 6) {
          clearInterval(intervalId);
          this.showCounter = false;
          this.imageSource = this.sanitizer.bypassSecurityTrustResourceUrl(
            `data:image/png;base64, ${this.clearImage}`
          );
          return;
        }
        this.changeImage();
      }
    }, 1000);
  }

  changeImage() {
    this.imageSource = this.sanitizer.bypassSecurityTrustResourceUrl(
      `data:image/png;base64, ${this.images[this.nextImageIndex]}`
    );
  }

  submitForm() {
    if (this.formGroup.valid) {
      const data = this.formGroup.getRawValue();
      if (data.guess.toLowerCase() === this.object.toLowerCase()) {
        this.hasGuessed = true;
        this.showCounter = false;

        this.guessTheImageService.addScore(this.nextImageIndex + 1).subscribe();
      }
    }
  }
}
